%[text] # verifying self-shadowing function
clc
clear
close all

const = orbitConst %[output:3fe9d069]
%%
%[text] ## load object
sat = readSC('boxWing4.obj'); %[output:249f52b2]
% sat.kappa = 0;
% sat.Cd = 0.5;
% sat.Cs = 0.5;
% sat.Ca = 0.5;

size(sat.vertices) % nVertices %[output:2073431b]
size(sat.faces) % nFaces %[output:4f4ce173]

showSC(sat) %[output:6bab99d3]
%%
%[text] ## parameters
sun = [0.8 -0.3 0.62]; % nominal sun vector
sun = rand(1,3);
sun = sun./norm(sun);
sunDist = const.AU * 10^3; % m
%[text] ### codegen
%[text] mex化する関数に `%#codegen` をつける
%[text] つけたあとに出てくるエラーを解消する
%[text] `codegen (filename).(拡張子) -args {}`
%[text] **-argsの中身の型はmex化関数を呼び出すときの引数の型と同じにする**
%[text] `(filename)_mex.mexmaca64`ファイルと`codegen`フォルダが作成される
%[text] 使い方は普通の関数と同じ
%[text] `(filename)_mex(引数)`
% tmpsunB = ones(1,3);
% tmpd = ones(1,1);
% codegen -report srpSimple.mlx -args {sat,tmpsunB,tmpd,const}
tmpsun = ones(1,3,1);
% sat.shadowFlag = zeros(size(sat.faces,1),1);
tmpN = [0 0 1];
tmpVertJ = ones(3,3);
tmpPos = [1, 1, 1];
% codegen -report calcSelfShadow.mlx -args {tmpsun, tmpN, tmpVertJ, tmpPos}

codegen -report selfShadow.mlx -args {sat, tmpsun} % 三角facetと四角facetに応じて作り直さないとダメ %[output:1c940ed6]

%%
% sat = srpSimple(sat, sun, sunDist, const); % calc. SRP

tic
sat = selfShadow(sat, sun); % calc self shadowing
toc %[output:87425a89]

tic
satMex = selfShadow_mex4(sat, sun); % calc self shadowing %[output:7eb19d35]
toc
%%
%[text] ## show figures
%[text] for non-mex function
figure
hold on
cb = colorbar;
colormap bone
% caxis([0 1e-7])

satFig = patch('Faces',sat.faces,'Vertices',sat.vertices);
set(satFig, 'FaceColor', 'b');
set(satFig, 'FaceLighting','phong','EdgeLighting','phong');
set(satFig, 'FaceVertexCData', sat.shadowFlag, 'FaceColor', 'flat')

axis equal
grid on
xlabel('X'),ylabel('Y'),zlabel('Z')
view(130,30);
quiver3(0, 0, 0, 3*sun(1),3*sun(2),3*sun(3) ,'r') % show sun direction
%[text] for mex function
figure
hold on
cb = colorbar;
colormap bone
% caxis([0 1e-7])

satFig = patch('Faces',satMex.faces,'Vertices',satMex.vertices);
set(satFig, 'FaceColor', 'b');
set(satFig, 'FaceLighting','phong','EdgeLighting','phong');
set(satFig, 'FaceVertexCData', satMex.shadowFlag, 'FaceColor', 'flat')

axis equal
grid on
xlabel('X'),ylabel('Y'),zlabel('Z')
view(130,30);
quiver3(0, 0, 0, 3*sun(1),3*sun(2),3*sun(3) ,'r') % show sun direction
